import React,{useState} from 'react';
import ReactDOM from 'react-dom/client';

const success = ({result,message}) =>{



    return(

        <div id="success">
            {
            {result}?(
            <>
            <h4>Success</h4>
            <h2>{result}</h2>
            </>

            ): <>
                <h4>Fail</h4>
                <h2>{message}</h2>
                </>
            }
        </div>
    );
}

export default success;
